import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col, Image } from 'react-bootstrap';
import imgBanner from './img/home-banner.png';

function App() {
    return (
        <Container>
            <Row>
                <img 
                    src={imgBanner}
                    alt="header banner"
                    style={{ width:"100%" }}
                />
            </Row>
            <Row>
                <Col xs={12} md={12}>
                    <div className="hdr-home" >
                        JOB OPPORTUNITIES
                    </div>
                </Col>
            </Row>
            <Row>
                <Col xs={12} md={12}>
                    <table style={{ width:"100%" }}>
                        <tbody>
                            <tr>
                                <td style={{ width:"50%", textAlign:"center" }}>
                                    <img 
                                        src={imgBanner}
                                        alt="header banner"
                                        style={{ width:"100%" }}
                                    />
                                    <div className="home-subtle" >
                                        RETAIL ASSISTANCE
                                    </div>
                                </td>
                                <td style={{ width:"50%" }}>
                                    picture 2
                                </td>
                            </tr>
                        </tbody>
                    </table>
                </Col>
            </Row>
        </Container>
    );
}

export default App;
